import dayjs from 'dayjs';


const PersonItem = ({ item }) => {
    return (

        <div class="profile-container">
             <div class="profile-card">
             <img src={item?.image} class="profile-icon" />
             <div class="profile-name">{item?.first_name} {item?.last_name}</div>
             <div class="profile-position">{item?.description}</div>
             <p className='profile-text center'>
                        {dayjs(item?.date).format('DD MMMM YYYY')}
             </p>
             <button className="see-more btn btn-outline-success" type="submit">Book Now</button>
             </div>
        </div>  

    )
};

export default PersonItem;
